import axios from "axios";

const api = axios.create({
  baseURL: "https://api.themoviedb.org/",
  params: {
    api_key: "44ebf9cf927b173d893cd89ea3db2e1e",
    language: "en-US"
  }
});

api.get("tv/popular");

export default api;
